import React from 'react';
import Button from 'react-bootstrap/Button';

export const ProfileData = ({ graphData, onProfileDataRequest, onMenuGClick }) => {
  return (
    <div>
      {graphData ? (
        <div>
          <h5>Welcome, {graphData.givenName} {graphData.surname}!</h5>
          <p>Email: {graphData.email}</p>
          <p>City: {graphData.city}</p>
          <Button onClick={onMenuGClick}>Show MenuG</Button>
        </div>
      ) : (
        <div>
          <p>Loading profile data...</p>
          <Button onClick={onProfileDataRequest}>Request Profile Information</Button>
        </div>
      )}
    </div>
  );
};
